import React from 'react'
import Log from './Log'

export default function BJJLogs({logs}) {

   const deleteLog = (logID) => {
        logs.splice(logs[logID], 1)
    }

    return (
       
        <div id="bjjLogsCon">
            
           {logs.map(log => {
               return <Log key={log.id} log={log} />
           })}
           
        </div>
      
    )
}
